import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { CarService } from 'src/app/services/car.service';

@Component({
  selector: 'app-booking',
  templateUrl: './booking.component.html',
  styleUrls: ['./booking.component.css']
})
export class BookingComponent {

  carId: string = '';
  locationId: string = '';
  carDetails: any;
  locations: any [] = [];
  bookingobj: any ={
    "bookingId": 0,
    "customerId": 0,
    "fromLocationId": 0,
    "toLocationId": 0,
    "travelDate": "2024-02-29T09:37:10.694Z",
    "startTime": "string",
    "carId": 0,
    "pickupAddress": "string",
    "alternateContactNo": "string",
    "invoiceNo": "string",
    "isComplete": true
  }
constructor(private activateRoute:ActivatedRoute,private service:CarService){
  this.activateRoute.params.subscribe((res:any)=>{
    this.carId = res.carId;
    this.locationId = res.locationId;
    this.getCarDetails();
  })
}

getCarDetails(){
  this.service.GetCarById(this.carId).subscribe((res:any)=>{
    this.carDetails = res.data;
  })
}
}
